const App: React.FC = () => {
  const [open, setOpen] = useState(false);
  const [value, setValue] = useState<string>('null-footer');
  const [footer, setFooter] = useState<React.ReactNode | null>(null);

  const showDrawer = () => {
    setOpen(true);
  };

  const onClose = () => {
    setOpen(false);
  };

  const onChange = (e: RadioChangeEvent) => {
    const value = e.target.value;
    if (value === 'null-footer') {
      setFooter(null);
    } else {
      setFooter(<div>Custom Footer</div>);
    }
    setValue(value);
  };

  const getPopupContainer = () =>
    document.getElementById('drawer-footer') as unknown as HTMLElement;

  return (
    <div id="drawer-footer">
      <Space>
        <Radio.Group value={value} onChange={onChange}>
          <Radio value="custom">\u81EA\u5B9A\u4E49footer</Radio>
          <Radio value="null-footer">\u4E0D\u9700\u8981footer</Radio>
        </Radio.Group>
        <Button type="primary" onClick={showDrawer}>
          Open
        </Button>
      </Space>
      <Drawer
        title="Basic Drawer"
        closable={false}
        onClose={onClose}
        open={open}
        getContainer={getPopupContainer}
        footer={footer}
      >
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Drawer>
    </div>
  );
};

export default App;
